INSERT INTO `bf_email_queue` (`id`, `to_email`, `subject`, `message`, `alt_message`, `max_attempts`, `attempts`, `success`, `date_published`, `last_attempt`, `date_sent`, `csv_attachment`) VALUES
(1, 'chvrlzhn@gmail.com', 'Terima Kasih telah melapor, Hafizhan!', 'Halo, Hafizhan\r\nTerima Kasih atas kontribusi Anda dengan melaporkan masalah mengenai persampahan kepada Kami. Laporan Anda pada tanggal 12 November 2017 akan kami tanggulangi secepatnya. Kami akan berusaha menciptakan Kota Pekanbaru yang bersih dan nyaman untuk Anda tinggali. Kami berharap Anda juga tidak bosan melaporkan masalah persampahan di lingkungan sekitar Anda.\r\nSalam,\r\nDKP Kota Pekanbaru', NULL, 3, 1, 1, NULL, '2017-11-25 18:53:46', '2017-11-25 18:53:46', NULL),
