(8, 'ekawdr@gmail.com', 'Terima Kasih telah melapor, Eka Wulandari!', '<html>\n<body leftmargin="0" marginwidth="0" topmargin="0" marginheight="0" offset="0" bgcolor=''#ececec''>\n<style>\n .headerTop { background-color:#FFCC66; border-top:0px solid #000000; border-bottom:1px solid #FFFFFF; text-align:center; }\n .adminText { font-size:10px; color:#996600; line-height:200%; font-family:verdana; text-decoration:none; }\n .headerBar { background-color:#FFFFFF; border-top:0px solid #333333; border-bottom:10px solid #FFFFFF; }\n .title { font-size:20px; font-weight:bold; color:#CC6600; font-family:arial; line-height:110%; }\n .subTitle { font-size:11px; font-weight:normal; color:#666666; font-style:italic; font-family:arial; }\n .defaultText { font-size:12px; color:#000000; line-height:150%; font-family:trebuchet ms; }\n .footerRow { background-color:#FFFFCC; border-top:10px solid #FFFFFF; }\n .footerText { font-size:10px; color:#996600; line-height:100%; font-family:verdana; }\n a { color:#FF6600; color:#FF6600; color:#FF6600; }\n</style>\n<table width="100%" cellpadding="10" cellspacing="0" class="backgroundTable">\n    <tr>\n        <td valign="top" align="center">\n            <table width="550" cellpadding="0" cellspacing="0" bgcolor="#fff" style="border: 1px solid #999">\n                <tr>\n                    <td style="background-color:#333;color: #fff;text-align:center;" align="center">\n<!--	<span style="font-size:10px;line-height:200%;font-family:verdana;text-decoration:none;">Email not displaying correctly? <a href="*|ARCHIVE|*" style="font-size:10px;line-height:200%;font-family:verdana;text-decoration:none;">View it in your browser.</a></span> -->\n                    </td>\n                </tr>\n                <tr>\n            </table>\n            <table width="550" cellpadding="20" cellspacing="0" bgcolor="#FFFFFF">\n                <tr>\n                    <td bgcolor="#FFFFFF" valign="top" style="font-size:12px;color:#000000;line-height:150%;font-family:trebuchet ms;"><h1>Halo, Eka Wulandari</h1>\r\n<h3 align="justify">Terima Kasih atas kontribusi Anda dengan melaporkan masalah mengenai persampahan kepada Kami. Laporan Anda pada tanggal 28 November 2017 akan kami tanggulangi secepatnya. Kami akan berusaha menciptakan Kota Pekanbaru yang bersih dan nyaman untuk Anda tinggali. Kami berharap Anda juga tidak bosan melaporkan masalah persampahan di lingkungan sekitar Anda.</h3>\r\n<h3>Salam,</h3>\r\n<h3>DKP Kota Pekanbaru</h3>						</td>\n					</tr>\n					<tr>\n						<td style="background-color:#fff;border-top:1px solid #ccc;" valign="top">\n							Copyright (C) 2014. All rights reserved.\n						</td>\n					</tr>\n				</table>\n			</td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, 3, 0, 0, NULL, NULL, NULL, NULL);
