(2, 'Struktur Organisasi', 'Profil DKP', '2017-11-12 14:37:55', '', 'Info-2.jpg'),
(3, 'Informasi Kontak', 'Profil DKP', '2017-11-12 14:55:15', '<p>Dinas Kebersihan dan Pertamanan (DKP) Kota Pekanbaru merupakan salah satu Satuan Kerja (Satker) yang berhubungan langsung dengan masyarakat. Oleh sebab itu, banyak aduan masyarakat yang diterima seperti persoalan kebersihan, sampah, penerangan jalan, dan sebagainya.</p>\r\n<p style="text-align: justify;">DKP telah menyiapkan layanan call center. Nomor tersebut dapat dihubungi oleh masyarakat sejak pukul 08.00 pagi hingga 21.00 malam.</p>\r\n<p style="text-align: justify;"><strong>&ldquo;Silahkan masyarakat menghubungi 0853-7450-5000 jika ada lampu jalan yang mati, sampah yang tidak terangkut, serta pohon yang tumbang,&rdquo;</strong></p>', ''),
(4, 'Jalanan di Kota Pekanbaru..', 'Informasi Publik', '2017-01-09 05:31:54', '<h1>Jalanan di Kota Pekanbaru Dipenuhi Tumpukan Sampah</h1>\r\n<p>Pemandangan tak sedap kembali mewarnai kota Pekanbaru sebagai ibu kota Provinsi Riau. Hampir di setiap sudut kota sampah kembali menumpuk.<br /><br />Persoalan sampah sepertinya tak pernah terselesaikan secara baik. Pemandangan sampah yang berserakan, seakan menjadi hal yang lumrah. Tidak hanya lambatnya Pemkot Pekanbaru dalam menangani sampah, terlebih masyarakatnya yang kurang sadar akan kebersihan.<br /><br />Pemandangan tumpukan sampah misalnya di ruas Jalan Soebrantas Kecamatan Tampan, Pekanbaru. Jalur paling padat ini di kanan- kiri badan jalan disesaki sampah.<br /><br /></p>\r\n<div id="beacon_af24d30331" style="position: absolute; left: 0px; top: 0px; visibility: hidden;"><img style="width: 0px; height: 0px;" src="https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=642&amp;loc=https%3A%2F%2Fnews.detik.com%2Fberita%2Fd-3390586%2Fjalanan-di-kota-pekanbaru-dipenuhi-tumpukan-sampah&amp;referer=https%3A%2F%2Fwww.google.com%2F&amp;cb=af24d30331" alt="" width="0" height="0" /></div>\r\n<p>Terlebih di persimpangan Jl Soebrantas dengan Jl Delima. Saban hari di tepi jalan itu seperti dijadikan tempat pembuangan sampah rumah tangga oleh masyarakat.<br /><br />Akibat pembuangan sampah sembarangan itu, ruas badan jalan pun kini tertutup sampah. Sudah lebih tiga hari, sampah di jalan tersebut dibiarkan berserakan. Tumpukan sampah itu selebar dua meter dengan panjang sekitar 30 meter.<br /><br />Berbagai kotoran rumah tangga ditumpuk di sana. Sampah yang berserakan itu kini menimbulkan bau tak sedap.<br /><br />Pemandangan yang sama juga terjadi di sepanjang Jl Soekarno Hatta tak jauh dari Rumah Sakit ternama di Pekanbaru, Eka Hospital. Kanan kiri badan jalan kini disesaki sampah. Baik siang dan malam, dengan gampangnya masyarakat membuang sampah di pinggir jalan.<br /><br />Masyarakat yang membuang sampah di tepi jalan seperti tak merasa berdosa. Pantauan detikcom, Minggu (8/1/2017), banyak warga yang menggunakan sepeda motor membuang sampahnya di tepi Jl Soebrantas.<br /><br />"Saban hari warga buang sampah di sini. Kita sudah pernah melarang warga agar jangan buang sampah di jalan. Karena baunya sampai ke dalam ruko," kata Asmar (25) seorang penjaga toko.</p>\r\n<p>Persoalan sampah di Pekanbaru ini memang sudah lama terjadi. Mulai dari persoalan internalnya Pemkot Pekanbaru terhadap pihak ketiga pengelola sampah, sampai warganya yang kurang kesadaran.<br /><br />"Padahal masing-masing RT biasanya ada swakelola sampah yang dilakukan warga. Tapi anehnya, masih banyak warga yang sembarangan buang sampah. Kita tidak bisa menyalahkan sepenuhnya kepada pemerintah, tapi kesadaran warga itu juga penting," kata Ari Nadem seorang warga Pekanbaru. <br /><strong>(cha/rvk)</strong></p>', 'Info-4.jpg');
INSERT INTO `bf_informasi` (`id_informasi`, `judul_informasi`, `kategori_informasi`, `tgl_terbit_informasi`, `isi_informasi`, `foto_informasi`) VALUES
(5, 'Di Pekanbaru, Sampah Kembali..', 'Informasi Publik', '2017-01-07 13:50:13', '<p><strong>Di Pekanbaru, Sampah Kembali Jadi Masalah</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong> Sampah masih saja menjadi masalah yang tak ada habisnya di Kota Pekanbaru. Tumpukan-tumpukan sampah kembali terlihat di beberapa ruas jalan dalam kota.<br /><br />Pantauan Riau Pos di beberapa lokasi masih terlihat sampah-sampah di sepanjang Jalan Tuanku Tambusai dan beberapa ruas jalan yang bersimpangan dengan Jalan Tuanku Tambusai, Jumat (6/1).<br /><br />Seperti di simpang Jalan Taskurun dan Jalan Tuanku Tambusai, sampah menumpuk dan mengeluarkan bau tidak sedap beberapa hari belakangan. <br /><br />Warga yang melewati jalan tersebut langsung menutup pintu kaca mobil, sementara pejalan kaki terpaksa sedikit berlari agar cepat terhindar dari bau tidak sedap.<br /><br />Di persimpangan Jalan Duyung dengan Jalan Arwana juga terlihat beberapa warga perumahan membersihkan tumpukan sampah. <br /><br />Setelah berhasil membuang sampah yang menumpuk disekitar perumahan mereka, warga langsung memasang plang yang meminta agar tidak ada yang membuang sampah dilingkungan mereka. <br /><br />Bahkan sepenggal kalimat yang tertulis di palang menunjukkan kalimat ancaman seperti Berani buang sampah disini akan berurusan dengan warga,.<br /><br />Beberapa tumpukan sampah yang terlihat cukup banyak itu di Jalan Sudirman dekat persimpangan Jalan Nangka, Jalan Tuanku Tambusai tepatnya dipersimpangan Jalan Garuda dan Gang Subur.<br /><br />Sikap pemerintah kota yang dianggap tidak peduli dengan kebersihan kota ini sangat disayangkan oleh masyarakat. Harusnya menurut masyarakat, Jalan Sudirman dan Jalan Tuanku Tambusai yang merupakan jalan protokol tidak sepantasnya ada tumpukan sampah. <br /><br />Karena dua jalan ini merupakan tempat sentral bisnis. <br /><br />Seharusnya dengan telah diraihnya Adipura oleh Kota Pekanbaru selama tujuh kali berturut-turut, tidak ada lagi tumpukan sampah seperti sekarang. Tapi sekarang yang terjadi malah terbalik, sampah menumpuk dimana-mana, dan di jalan protokol lagi, kata Makbul, warga Jalan Tuanku Tambusai.<br /><br />Hal yang sama juga diungkapkan Adit. Menurutnya, kalau dipandang secara sepintas memang Pekanbaru masih tertata dengan baik. Tapi kalau dilihat dari segi kebersihan, Pekanbaru masih dianggap sangat jauh. <br /><br />Terlebih katanya, dalam tahun 2011 sampai tahun 2012 ini kebersihan Kota Pekanbaru benar-benar menurun. <br /><br />Dulu katanya di persimpangan Jalan Nangka-Sudirman itu sama sekali tidak ada sampah. Namun sekarang persimpangan itu dijadikan sebagai tempat pembuangan sampah.<br /><br />Tidak seriusnya pemerintah dalam menyelesaikan masalah sampah ini juga sempat dikecam oleh anggota Komisi I DPRD Pekanbaru Adri Yanto. <br /><br />Kita masih belum melihat keseriusan pemerintah dalam menyelesaikan masalah sampah di Kota kita ini. Banyak sampah menumpuk telah membuat kota kita menjadi bau dan meresahkan warga, kata Adri.<br /><br />Tak Ada BBM, Mobil Sampah Tak Beroperasi<br />Dalam pada itu, kondisi menumpuknya sampah-sampah ini sudah diprediksikan sebelumnya oleh Kepala Dinas Kebersihan dan Pertamanan (DKP) Pekanbaru Syafrizal Bakar. <br /><br />Sebelumnya kepada Riau Pos, Syafrizal Bakar menyebutkan tidak adanya anggaran membuat pihaknya tidak bisa membeli bahan bakar minyak (BBM) mobil pengangkut sampah. Akibatnya, mobil-mobil tersebut tidak bisa beroperasi. <br /><br />Namun saat dikonfrimasi ulang, Kepala DKP Pekanbaru melalui Kepala Seksi Kebersihan Lingkungan M Syukri membantah tidak beroperasinya mobil pengangkut sampah tersebut. Menurutnya tidak ada mobil yang tidak beroperasi. <br /><br />Mobil kita tidak ada mogok, semuanya jalan. Tadi pagi memang benar, karena sempat tidak ada minyak, tapi sekarang sudah tidak lagi, karena sudah coba untuk kita atasi,katanya.(rul/lim)</strong></p>\r\n<div style="overflow: hidden; color: #000000; background-color: #ffffff; text-align: left; text-decoration: none;"><br />Read more: <a style="color: #003399;" href="http://www.riaupos.co/7766-berita-di-pekanbaru,-sampah-kembali-jadi-masalah.html#ixzz4zSr4PgwU">http://www.riaupos.co/7766-berita-di-pekanbaru,-sampah-kembali-jadi-masalah.html#ixzz4zSr4PgwU</a></div>', 'Info-51.jpg');
