INSERT INTO `bf_laporan_masyarakat` (`id_laporanmas`, `tgl_laporanmas`, `nama_pe_laporanmas`, `notel_laporanmas`, `email_laporanmas`, `kelurahan_laporanmas`, `kecamatan_laporanmas`, `isi_laporanmas`, `foto_laporanmas`, `id_tps`, `balasan`, `tanggal_balasan`, `status_laporan`) VALUES
(9, '2017-11-28 10:09:04', 'Eka Wulandari', '081275082383', 'ekawdr@gmail.com', 'Simpang Baru', 'Tampan', 'Di jalan bangau sakti ini ada lokasi sampah yang sudah berbulan-bulan tidak diangkut. Sampahnya juga sudah memenuhi badan jalan.', 'Eka_Wulandari-171128100904.jpg', '0.4842938928847859 # 101.37601017951967', '{"to":"ekawdr@gmail.com","subject":"Terima Kasih telah melapor, Eka Wulandari!","message":"<h1>Halo, Eka Wulandari<\\/h1>\\r\\n<h3 align=\\"justify\\">Terima Kasih atas kontribusi Anda dengan melaporkan masalah mengenai persampahan kepada Kami. Laporan Anda pada tanggal 28 November 2017 akan kami tanggulangi secepatnya. Kami akan berusaha menciptakan Kota Pekanbaru yang bersih dan nyaman untuk Anda tinggali. Kami berharap Anda juga tidak bosan melaporkan masalah persampahan di lingkungan sekitar Anda.<\\/h3>\\r\\n<h3>Salam,<\\/h3>\\r\\n<h3>DKP Kota Pekanbaru<\\/h3>"}', '2017-12-12', 1),
(10, '2017-11-28 10:10:40', 'Windy Syafitri', '09876543727', 'windy@gmail.com', 'Delima', 'Tampan', 'TPS di Srikandi saat ini berserakan sampai ke jalan. Sudah seminggu belum diangkut.', 'Windy_Syafitri-171128101040.jpg', '14', NULL, NULL, 0),
(11, '2017-11-28 10:13:16', 'Aszani', '081266983873', 'aszasani@gmail.com', 'Simpang Baru', 'Tampan', 'Di daerah sekitar jalan merpati sakti ada TPS liar, mohon segera ditindak lanjuti karena baunya sudah sangat meresahkan warga', 'Aszani-171128101316.jpg', '0.47286808109847106 # 101.36855363845827', NULL, NULL, 0),
(12, '2017-12-12 10:15:51', 'Eka Wulandari', '081266389873', 'ekawdr@gmail.com', 'Simpang Baru', 'Tampan', 'TPS di jalan Bangau Sakti ini sudah berbulan-bulan tidak diangkut dan sampahnya sudah sampai ke badan jalan. Mohon segera diatasi.', 'Eka_Wulandari-171212101551.jpg', '0.4871798460724655 # 101.37648224830627', NULL, NULL, 0);
